import LogItem from "./LogItem";
import "../Logs/Logs.css" ;
import Card from "../UI/Card";

const Logs = (props) =>{

      

    const logItemData = props.logsData.map(
        (item ,index)=> <
         LogItem 
        //  logIndex = {index}
         onDelete={()=>props.onDelete(index)} 
         key ={item.id}
         date={item.date} 
         desc={item.desc} 
         time ={item.time} 
         
         />)

    return <Card className="logs"> 
    

        {
          (logItemData ? logItemData : (<p></p>))
        }


        {/* <LogItem/>
        <LogItem/>
        <LogItem/>
        <LogItem/> */}

        </Card>


};

export default Logs;
